INSERT INTO public.structure_record ("structureRecordId", "groupStructureId", "structureId", "parentRecordId", "name", "nameNative", "code", "description", "enrollableCategory", "schoolType", "photo", "recordType", "tags", "statistic", "countStructure", "isPromoted", "isFeatured", "isPublic", "isOpen", "startDate", "endDate", "extra", "createdAt", "updatedAt", "mpath", "qty", "phone", "structurePath", "schoolId", "campusId", "archiveStatus", "status", "share", "responsibleBy") VALUES ('c7b49d60-781f-4951-a7f3-12215d506b39', '6856443f-259a-4b65-b4ed-647f00c5bf70', '762c994f-b913-4358-9301-860a040881b3', '394dff95-a559-4b90-92c2-87998fac7381', 'QA tester', 'QA tester', 'QA tester', '<h2>About the job</h2>

<p><strong>Main Responsibilities for QA Tester: </strong></p>

<p>&nbsp;</p>

<ul>
	<li>Create tests to identify software problems &amp; test cases.</li>
	<li>Executes test cases under varying circumstances</li>
	<li>Documents and evaluates test results</li>
	<li>Detects, logs, and reports program bugs and glitches</li>
	<li>Tracks defects and helps troubleshoot errors</li>
	<li>Recommend improvements in software to enhance user experience</li>
	<li>Partners with engineers to drive QA efforts</li>
	<li>Develop standards and procedures to determine product quality and release readiness</li>
	<li>Identify any potential problems that users might encounter.</li>
</ul>

<p>&nbsp;</p>

<p><strong>Requirements: </strong></p>

<p>&nbsp;</p>

<ul>
	<li>Bachelor&rsquo;s degree in Computer Science, Software Engineering, or related field</li>
	<li>Minimum 1 year of QA testing experience</li>
	<li>Experience in writing clear, concise and comprehensive test plans and test cases ∙</li>
	<li>Experience in Agile frameworks and regression testing desired</li>
	<li>High attention to detail and solid analytical skills</li>
	<li>Proficient in test management software</li>
	<li>A good working knowledge of test management software, programming languages, and QA methodologies.</li>
	<li>Outstanding written and verbal communication skills</li>
	<li>Good team working and critical thinking skills.</li>
