INSERT INTO public.structure_record ("structureRecordId", "groupStructureId", "structureId", "parentRecordId", "name", "nameNative", "code", "description", "enrollableCategory", "schoolType", "photo", "recordType", "tags", "statistic", "countStructure", "isPromoted", "isFeatured", "isPublic", "isOpen", "startDate", "endDate", "extra", "createdAt", "updatedAt", "mpath", "qty", "phone", "structurePath", "schoolId", "campusId", "archiveStatus", "status", "share", "responsibleBy") VALUES ('d615e301-ab28-4df4-976a-a1c0954c7b6b', '436e704b-b930-4031-ba2a-008ef573f084', 'b3a2c4cf-56f6-46df-bace-7f05bd479d30', '7a70f340-9e8f-4085-993a-f24f9aeac2a7', 'Brand and Marketing specialist ', 'Brand and Marketing specialist ', 'Brand and Marketing ', '<p><strong>Company Description</strong><br />
&ldquo;To be the most loved everyday food and groceries destination!&rdquo; - that&rsquo;s our mission at foodpanda (small &lsquo;f&rsquo;).</p>

<p>foodpanda is the largest food and grocery delivery platform in Asia, outside of China. Operating in more than 400 cities across 11 markets, we continue to expand and grow in our core food delivery business, as well as in new verticals like grocery deliveries, with a strong tech infrastructure at our core. From our restaurants-partners, cloud kitchens and cloud grocery stores &mdash; foodpanda is just one tap away, getting everything you need into your hands quickly and conveniently!</p>

<p>If you love working with technology to create solutions and are not afraid to roll up your sleeves to get things done, you will find your tribe here at foodpanda. foodpanda comprises of people from more than 60 nationalities, and we believe in winning through diversity.<br />
foodpanda is part of the Delivery Hero Group, the world&rsquo;s leading local delivery platform operating in 70+ countries worldwide</p>

<p><strong>Job Description</strong><br />
<strong>What&#39;s on your menu?</strong></p>

<p>- Work with key business stakeholders, with cross functional departments &amp; HQ brand strategy &amp; media teams to strategize most effective brand communication and media strategy&nbsp;<br />
- Full ownership of ATL channels including (but not limited to) Out of home, influencers, social media, online branding, &nbsp;and other possible effective communication channels, &nbsp;in turning the cities pink! Ensure utmost execution and planning of brand communications and media plan, to drive business KPIs such as customers&rsquo; acquisitions and adoption, as well as brand KPI such as Top of Mind and Brand Love.&nbsp;<br />
- Take ownership of creative campaigns i.e. campaigns concept development, vdo / photo production for all of the brand&rsquo;s media assets and media go to market strategy<br />
- Liaise with management team, &nbsp;regional brand / creative team &amp; external agencies to ensure timely delivery of required assets<br />
- Identify impactful communication channels to successfully communicate brand story, branding campaigns in both online and offline (ATL channels) to maximise long term and short term brand objectives aligned with company&rsquo;s goals<br />
- Lead creative direction for external &amp; internal media with close coordination with internal communications and external agencies<br />
- Keeping up with market trends in advertising media and social media, to successfully drive creative campaigns<br />
Evaluation of creative marketing campaigns to continuously improve ROI</p>

<p><strong>What do you bring to the table?</strong></p>

<p>- 2-3 years experience in branding<br />
- Bachelor&#39;s Degree in Business, Marketing or related areas<br />
- Experience in FMCG, Retail Business, E-Commerce, [Advertising agency]<br />
- Strong planning &amp; communication skills, ability to present ideas and concepts to relevant stakeholders<br />
- Deep knowledge of the production process including storyboarding, shooting, editing and post-production<br />
- You know how to handle processes end to end, influence decision at management level and manage budgets</p>
', NULL, NULL, NULL, NULL, '[]', '{"countStudent": 0, "countSubject": 0, "countTeacher": 0}', NULL, 'f', 'f', 't', 't', '2024-05-27 17:00:00+00', '2024-06-30 16:59:59+00', '[]', '2024-05-29 04:58:44.848743+00', '2024-06-24 10:26:58.549234+00', NULL, '2', NULL, '7a70f340-9e8f-4085-993a-f24f9aeac2a7#42b96c12-4ea4-4329-b372-2e8e5f79e453', '8001ea7c-945c-4b95-81a6-044c67b53a52', '9899e202-3c52-478c-9845-ba7fbc1cef7f', '0', 'progress', NULL, '["lysang@sala.co"]');
